import React from 'react';
import '../../App.css';
import './SignUp.css';
import ImageSlider from "./../ImageSlider";
import './../Gallery.css';

const SignUp = () => {
  const slides0 = [
    { url: "myImages/sheep.jpg", title: "beach" },
    { url: "myImages/lake.webp", title: "boat" },
    { url: "myImages/rose.webp", title: "forest" },
  ];


  const containerStyles = {
    width: "635px",
    height: "500px",
    margin: "0 auto",
  };


  return (
    <div>
      <div className="my_photo" style={containerStyles}>
        <ImageSlider slides={slides0} />
      </div>
      <div className='sign-up'>
  <a href='https://www.instagram.com/shiva74o6/' className='my_image_text'> Shiva <i class="fa-brands fa-instagram"></i></a>
  </div>



    </div>
  );
}

export default SignUp;
